import Total from "./Total";

const Networth = ({
  networths,
  formatToCurrency,
  currency,
  currency_codes
}) => {
  return (
    <table className="table">
      <tbody>
        {networths.map(networth => (
          <Total
            key={networth.id}
            total={networth}
            formatToCurrency={formatToCurrency}
            currency={currency}
            currency_codes={currency_codes}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Networth;
